Lair.create!([
  {title: "Wayne Manor/ Batcave", description: "Join me in my cozy, 36 bedroom/ 20 bath manor. Wayne Manor has been in my family for generations, and is easily accessible from Gotham city via any mode of transportation, including but not limited to car, submarine, and invisible jet. If all the rooms in the main house are booked, I have a couch in the Batcave that you could probably use for a few days. ", rate: 150, owner_id: 1, lair_type: "underground", room_type: "private-room", street_address: "135 West Gate Drive", city: "Huntington", state: "NY", country: "USA", latitude: 40.8289666, longitude: -73.4484497, max_guests: 10},
  {title: "Fortress of Solitude", description: "This is, in a rather convoluted way, my ancestral home. It's just my summer home now, so it's available for use all winter long. It's a little out of the way, but you won't find quieter neighbors. I definitely recommend bringing a sleeping bag - it gets a little chilly at night. Also my dad sometimes shows up, but that's usually only in times of great need.", rate: 30, owner_id: 2, lair_type: "fortress", room_type: "entire-hq", street_address: "101 St. Nicholas Drive", city: "North Pole", state: "AK", country: "USA", latitude: 64.7548317, longitude: -147.3431046, max_guests: 3},
  {title: "Daily Planet Office", description: "You won't find a less expensive place to stay in the heart of Metropolis! I am making that couch at my office at the Daily Planet available for you to rent while I'm out of town on some... errands. Given that the couch is in the middle of a working daily newspaper, there will always be someone around to keep you company and make you stick to your deadlines. Fair warning: a kid named Jimmy Olsen might try and take photos of you. ", rate: 20, owner_id: 2, lair_type: "office", room_type: "shared-room", street_address: "620 Eighth Avenue", city: "New York", state: "NY", country: "USA", latitude: 40.7562054, longitude: -73.9899143, max_guests: 1},
  {title: "Cozy Urban Dwelling", description: "All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.All work and no play makes Jack a dull boy.", rate: 10, owner_id: 9, lair_type: "underground", room_type: "shared-room", street_address: "183 Lorraine St", city: "Brooklyn", state: "NY", country: "USA", latitude: 40.6732938, longitude: -74.001732, max_guests: 10},
  {title: "The Matrix", description: "My house is just like any other house. But one day I realized that it was perhaps too much like the other houses. My neighbors look and act like me, but I can't get over this feeling that there's a bigger, unexplored world that I truly belong in. You can crash at my place while I search for answers. Free thinkers only, no suits.", rate: 30, owner_id: 13, lair_type: "underground", room_type: "entire-hq", street_address: "76 9th Ave", city: "New York", state: "NY", country: "USA", latitude: 40.7417806, longitude: -74.0045012, max_guests: 2}
